import { Component } from "react";

export class Filter extends Component {
  state = {
    filter: "",
  };

  handleChangeFilter = (event) => {
    this.setState({ filter: event.currentTarget.value });
  };
  render() {
    const { filter } = this.state;
    return (
      <input
        type="text"
        placeholder="Search..."
        value={filter}
        onChange={this.handleChangeFilter}
      />
    );
  }
}
